import React from "react";
import store from "./Store/index";
import { Provider } from "react-redux";
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from "react-router-dom";
import Refund from "./components/Refund";
import ContainerQrCodeScanner from "./components/ContainerQrCodeScanner";
import InvoiceRefund from "./components/InvoiceRefund";
import Loading from "./components/Loading";
import Error404 from "./components/Error404";

import "./App.css";

function App() {
  return (
    <Provider store={store}>
      <Router>
        <Switch>
          <Redirect exact from="/" to="refundoverview" />
          <h2> Welcome to Refund App </h2>
          <Route exact path="/refundoverview" component={InvoiceRefund} />
          <Route exact path="/refundoverview" component={Loading} />
          <Route exact path="/qrscan" component={ContainerQrCodeScanner} />
          <Route exact path="/refund" component={Refund} />

          <Route component={Error404} />
        </Switch>
      </Router>
    </Provider>
  );
}

export default App;
